Prototyp
Prototype Pattern says that cloning of an existing object instead of creating new one and can also be customized as per the requirement (Cloneable).
This pattern should be followed, if the cost of creating a new object is expensive and resource intensive.
Usage of Prototype Pattern

When the classes are instantiated at runtime.
When the cost of creating an object is expensive or complicated.

public interface PrototypeCapable extends Cloneable {
    public PrototypeCapable clone() throws CloneNotSupportedException;
}

public class Movie implements PrototypeCapable {
    private String name = null;
    public String getName() {
        return name;
    }
    public void setName(String name) {
        this.name = name;
    }

    @Override
    public Movie clone() throws CloneNotSupportedException {
        System.out.println("Cloning Movie object..");
        return (Movie) super.clone();
    }

    @Override
    public String toString() {
        return "Movie";
    }
}

public class Album implements PrototypeCapable {
    private String name = null;
    public String getName() {
        return name;
    }
    public void setName(String name) {
        this.name = name;
    }
    @Override
    public Album clone() throws CloneNotSupportedException {
        System.out.println("Cloning Album object..");
        return (Album) super.clone();
    }
    @Override
    public String toString() {
        return "Album";
    }
}

public class PrototypeFactory {

    public static class ModelType {
        public static final String MOVIE = "movie";
        public static final String ALBUM = "album";
    }
    private static java.util.Map prototypes = new java.util.HashMap();

    static {
        prototypes.put(ModelType.MOVIE, new Movie());
        prototypes.put(ModelType.ALBUM, new Album());
    }

    public static PrototypeCapable getInstance(final String s) throws CloneNotSupportedException {
        return ((PrototypeCapable) prototypes.get(s)).clone();
    }
}

